import React from 'react'
import './CustomButton.Style.scss'

const CustomButton = ({children,inverted, ...otherProps}) =>(
    <button className={`${ inverted? 'inverted': ''} custom-button`} {...otherProps}>
        {children}
    </button>
)

export default CustomButton;
